  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Devils Lake Wetland
  Management District outlines District accomplishments for the calendar year of 1971.
  The report begins by summarizing the water conditions during this period. Wildlife-
  including migratory birds, upland game birds, big game animals, fur animals, predators,
  rodents, and other mammals, reptiles, and disease- is also covered. The District
  development and maintenance section discusses physical developments, plantings,
  collections and receipts, and vegetation control. Resource management is outlined;
  topics include grazing, haying, and fur harvesting. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes recreational uses, District visitors, District participation, hunting,
  violations, and safety. Items of interest, N-R forms, photographs, and newspaper
  articles are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
